public class EndpointConfigFactory(string resourceName = null, Action<Humidifier.SageMaker.EndpointConfig> factoryAction = null) : ResourceFactory<Humidifier.SageMaker.EndpointConfig>(resourceName)
{

    internal List<InnerEndpointConfigProductionVariantFactory> ShadowProductionVariantsFactories { get; set; } = [];

    internal List<InnerEndpointConfigProductionVariantFactory> ProductionVariantsFactories { get; set; } = [];

    internal InnerEndpointConfigDataCaptureConfigFactory DataCaptureConfigFactory { get; set; }

    internal InnerEndpointConfigAsyncInferenceConfigFactory AsyncInferenceConfigFactory { get; set; }

    internal InnerEndpointConfigVpcConfigFactory VpcConfigFactory { get; set; }

    internal InnerEndpointConfigExplainerConfigFactory ExplainerConfigFactory { get; set; }

    protected override Humidifier.SageMaker.EndpointConfig Create()
    {
        var endpointConfigResult = CreateEndpointConfig();
        factoryAction?.Invoke(endpointConfigResult);

        return endpointConfigResult;
    }

    private Humidifier.SageMaker.EndpointConfig CreateEndpointConfig()
    {
        var endpointConfigResult = new Humidifier.SageMaker.EndpointConfig
        {
            GivenName = InputResourceName,
        };

        return endpointConfigResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.EndpointConfig result)
    {
        base.CreateChildren(result);

        result.ShadowProductionVariants = ShadowProductionVariantsFactories.Any() ? ShadowProductionVariantsFactories.Select(x => x.Build()).ToList() : null;
        result.ProductionVariants = ProductionVariantsFactories.Any() ? ProductionVariantsFactories.Select(x => x.Build()).ToList() : null;
        result.DataCaptureConfig ??= DataCaptureConfigFactory?.Build();
        result.AsyncInferenceConfig ??= AsyncInferenceConfigFactory?.Build();
        result.VpcConfig ??= VpcConfigFactory?.Build();
        result.ExplainerConfig ??= ExplainerConfigFactory?.Build();
    }

} // End Of Class

